import Header from './componentes/Header'
import Pesquisa  from './componentes/Pesquisa';
import styled from 'styled-components'

const AppContainer = styled.div`
    width: 100vw;
    height: 100vh;
    min-height: 100vh;
    overflow: auto;
    background-image: linear-gradient(90deg, #002F52 35%, #326589);
`


function App() {
  return (
    <AppContainer>
        <Header/>
        <Pesquisa />
    </AppContainer>
  );
}

export default App;
